column1:
Chat 4 Heart Health has ideas for monitoring your blood sugar & keeping it in a healthy range. Pick 1 of these or write in your own goal for the week to work on managing your cholesterol: 
(1) Set an alarm on my phone to monitor my blood sugar; 
(2) Think carefully about what I've been eating when I see a blood sugar reading out of range (too high or too low); 
(3) Check my blood sugar before each meal every day; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:44:04.090369-06|4|"{""1"":""I will set an alarm on my phone to monitor my blood sugar"",

Chat 4 Heart Health has ideas for monitoring your blood pressure and keeping it in a healthy range. Pick 1 of these or write in your own goal for the week: 
(1) Buy a home blood pressure monitoring system; 
(2) Measure my blood pressure 2X every day; 
(3) Reduce stress by paying attention to my breathing for 5 minutes on 3 days this week; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:44:30.114872-06|6|"{""1"": ""I will look into buying a home blood pressure monitoring system"",

Chat 4 Heart Health wants to help you to get moving this week. Pick one of these or write in your own goal to help your heart with physical activity: 
(1) I will add 5 minutes of walking to what I normally do each day this week; 
(2) I will make a date with a friend to go for a 20+ minute walk once this week; 
(3) I will take 5 minute breaks 3X each day to walk around the house or the block; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:40:40.47706-06|3|"{""1"":""I will add five minutes of walking to what I normally do each day this week"",

Chat 4 Heart Health has ideas for taking charge this week for healthy cholesterol. Pick 1 of these or write in your own goal for the week to work on managing your cholesterol: 
(1) I will include whole foods like beans and/or whole grains in 3-4 meals; 
(2) I will eat a vegetable portion with each dinner; 
(3) I will try to eat at least 5 servings of fruits or vegetables each day; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:43:42.222899-06|2|"{""1"": ""I will include whole foods like beans and/or whole grains in 3-4 meals this week"",

Chat 4 Heart Health wants to support your healthy eating this week. Write in the number from one of the goals here that you will do this week or write in your own goal to help your heart with healthy food: 
(1) I will add one portion of fruit or vegetable to one meal each day this week; 
(2) I will include whole grains like brown rice or whole wheat pasta in at least two meals this week;
 (3) I will use a smaller plate for dinner at least twice as a way to manage my portion size; 
(4) I want to decide my own goal.|2023-09-20 10:37:46.062479-06|2023-10-06 11:40:30.903561-06|1|"{""1"": ""I will add one portion of fruit or vegetable to one meal each day this week"",

Chat 4 Heart Health has some ideas to help you with sleep this week. Pick one of these or write in your own goal to give yourself the gift of restful sleep: 
(1) I will stop looking at my phone and other screens at least one hour before bed each night; 
(2) I will cut back on drinking coffee or alcohol in the evenings on at least 2 days this week; 
(3) I will treat myself to an eye mask and/or foam earplugs and try them out at least once this week; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:41:32.242463-06|5|"{""1"":  ""I will stop looking at my phone and other screens at least one hour before bed each night"",

Chat 4 Heart Health wants to help you with weight management. Pick 1 of these you think you can do or write in your own goal for the week: 
(1) I will talk to my family about preparing healthy recipes we all like; 
(2) I will eat my dinners on a smaller plate as a way to manage portions; 
(3) I will try to make sure my fork is never full at the same time as my mouth when I eat; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:42:22.460654-06|7|"{""1"": ""I will talk to my family about preparing healthy recipes we all like"",

Chat 4 Heart Health wants to help you to set a goal to make it easier to take meds. Pick 1 of these write in your own goal for the week: 
(1) Buy and use a pill box; 
(2) Set an alarm on my phone to remind me to take meds; 
(3) Ask a loved one to remind me; 
(4) I want to decide my own goal.|2023-09-13 00:00:00-06|2023-10-06 11:45:31.716629-06|8|"{""1"": ""I will buy and use a pill box"",
